import { Outlet } from "react-router"

const AppLayout = () =>{
    return(
        <>
            <Navbar />
            <div style={{
                border: '1px sol',
                padding: '16px',
            }}>
            <Outlet />
            </div>
        </>
    )
}

export default AppLayout
